using System;\nusing System.Collections.Generic;\nusing System.Web.Services.Protocols;\n\npublic class AccountServiceClient : SoapHttpClientProtocol\n{\n    public AccountServiceClient()\n    {\n        this.Url = "http://your-service-url";\n    }\n\n    [SoapDocumentMethod(\n        RequestNamespace = "http://example.com/YourRequestNamespace",\n        Use = SoapBindingUse.Literal,\n        RequestElementName = "registerAccountRequest")]\n    public string RegisterAccount(string key, Dictionary<string, string> data)\n    {\n        // Convert dictionary to List<KeyValuePair> because of Web Services serialization\n        var listData = new List<KeyValuePair<string, string>>(data);\n\n        object[] results = this.Invoke("RegisterAccount", new object[] { key, listData });\n        return (string)results[0];\n    }\n\n    public System.IAsyncResult RegisterAccountBegin(string key, Dictionary<string, string> data, System.AsyncCallback callback, object asyncState)\n    {\n        var listData = new List<KeyValuePair<string, string>>(data);\n        return this.BeginInvoke("RegisterAccount", new object[] { key, listData }, callback, asyncState);\n    }\n\n    public string RegisterAccountEnd(System.IAsyncResult asyncResult)\n    {\n        object[] results = this.EndInvoke(asyncResult);\n        return (string)results[0];\n    }\n}